import { observable, autorun, action } from 'mobx';

class Store {  
  @observable page = 'notes';
  @observable notes = [];

  @action changePage(value) {
    this.page = value;
  }
}

const store = new Store();

export default store;

autorun(() => {
  console.log(store.page);
})
